const Playlist = () => {
  return (
    <div className="flex-c-w m-up-6 center-x ">
      <div className="addToPlaylist p-x-2 br-3 create-playlist flex-row align-center is-4">
        <i className="bx is-primary bx-plus is-5 m-r-1"></i>
        <p className="m-y-1 semibold">Create new Playlist</p>
      </div>
      <div className="addToPlaylist m-up-4 p-x-2 br-3 create-playlist flex-row align-center is-4">
        <i className="bx bx-play-circle is-primary is-5 m-r-1"></i>
        <p className="m-y-1 regular">English Songs</p>
      </div>
    </div>
  );
};
export { Playlist };
